create table if not exists "BOOKS" (
  "ID" int not null generated by default as identity,
  "AUTHOR" clob,
  "LAUNCH_DATE" timestamp(6) not null,
  "PRICE" decimal(65, 2) not null,
  "TITLE" clob,
  primary key (id)
);

